import React from 'react';
import { CartProvider } from './context/CartContext';
import Home from './pages/Home';
import './FoodyZone.css';
import './styles/variables.css';
import './styles/animations.css';
import './styles/responsive.css';

function App() {
  return (
    <CartProvider>
      <div className="app">
        <Home />
      </div>
    </CartProvider>
  );
}

export default App;
